```
import React, { useState, useEffect } from 'react';

function DataList() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data List</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            <span>{item.name}</span>
            <span>{item.age}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DataList;
```
